import{_ as i,Q as a,S as l,a5 as n}from"./framework-ec2af7a3.js";const o={},t=n('<h1 id="说明" tabindex="-1"><a class="header-anchor" href="#说明" aria-hidden="true">#</a> 说明</h1><div class="hint-container note"><p class="hint-container-title">说明</p><p>这里主要介绍博客内容的编排</p><p>此外，这里还提供了某些常用工具网站的导航</p></div><h1 id="主页-关于" tabindex="-1"><a class="header-anchor" href="#主页-关于" aria-hidden="true">#</a> 主页&amp;关于</h1><p><mark>关于</mark> 页面中主要是关于本人的一些信息</p><p><mark>博客主页</mark> 主要是展示了近期发布的文章，还有文章的统计信息</p><figure><img src="https://my-photos-1.oss-cn-hangzhou.aliyuncs.com/markdown//blog/20230212/博客主页.png" alt="博客主页" tabindex="0" loading="lazy"><figcaption>博客主页</figcaption></figure><p>以下面板展示的所有信息都是可以点击的，例如可以点击 <code>Category</code> （分类）或者 <code>Tag</code> （标签）跳转到对应页面以选择想查看的某个分类的文章</p><figure><img src="https://my-photos-1.oss-cn-hangzhou.aliyuncs.com/markdown//blog/20230212/聚合信息入口.png" alt="聚合信息入口" tabindex="0" loading="lazy"><figcaption>聚合信息入口</figcaption></figure><p>上面图片底部的四篇文章都是作者，即本人标注了星标的内容，是单篇内容较多较好的文章</p><br><hr><br><h1 id="导航栏" tabindex="-1"><a class="header-anchor" href="#导航栏" aria-hidden="true">#</a> 导航栏</h1><p>顶部导航栏最右侧包含了 <mark>主题修</mark> 以及 <mark>搜索功能</mark></p><figure><img src="https://my-photos-1.oss-cn-hangzhou.aliyuncs.com/markdown//blog/20230212/顶部栏.png" alt="顶部导航栏" tabindex="0" loading="lazy"><figcaption>顶部导航栏</figcaption></figure><p>顶部导航栏还包含了所有文章分类，目前所有分类如下：</p><details class="hint-container details"><summary>目前全部分类</summary><ol><li><p>编程语言：</p><ul><li>Java</li><li>Go</li><li>Python</li></ul></li><li><p>算法</p></li><li><p>Springs</p></li><li><p>数据库：</p><ul><li>MySQL</li><li>Redis</li></ul></li><li><p>设计：</p><ul><li>设计模式</li></ul></li><li><p>中间件：</p><ul><li>RabbitMQ</li><li>ElasticSearch</li><li>MongoDB</li><li>Netty</li><li>Quartz</li></ul></li><li><p>运维：</p><ul><li>Git</li><li>Docker</li><li>Jenkins</li><li>Linux</li></ul></li><li><p>数学建模</p></li><li><p>其他文章（其他文章中也有很多内容）</p></li></ol></details><p>点入某个确定的分类后，<mark>左侧侧边栏</mark> 是该分类下的不同文章，比如当前处于的是「导航」分类，侧边栏则为：</p><figure><img src="https://my-photos-1.oss-cn-hangzhou.aliyuncs.com/markdown//blog/20230212/侧边导航栏.png" alt="侧边导航栏" tabindex="0" loading="lazy"><figcaption>侧边导航栏</figcaption></figure><p>在某个确定的文章中，<mark>右侧侧边栏</mark> 会有该文章各级标题的信息，可以直接点击跳转到对应的位置</p><figure><img src="https://my-photos-1.oss-cn-hangzhou.aliyuncs.com/markdown//blog/20230212/文章右侧导航栏.png" alt="文章右侧导航栏" tabindex="0" loading="lazy"><figcaption>文章右侧导航栏</figcaption></figure><p>补充：右侧侧边栏顶部右侧的 <mark>打印图标</mark> 是可以点击的，可以「打印」或者「导出」文章</p><br><hr><br><h1 id="评论" tabindex="-1"><a class="header-anchor" href="#评论" aria-hidden="true">#</a> 评论</h1><p>每篇文章底部都有评论区，需要进入 <mark>Github 授权</mark> 后才可以评论，有什么疑问都可以直接评论，本人会尽快回复</p><figure><img src="https://my-photos-1.oss-cn-hangzhou.aliyuncs.com/markdown//blog/20230212/评论区.png" alt="评论区" tabindex="0" loading="lazy"><figcaption>评论区</figcaption></figure>',28),r=[t];function e(p,c){return a(),l("div",null,r)}const h=i(o,[["render",e],["__file","index.html.vue"]]);export{h as default};
